function formatName(user){
    return user.firstName+ ' '+ user.lastName;
}
const user={
    firstName:"Tymur",
    lastName:"Radjapov"
};
const element=(
    <h1>
        Welcome to wonderful world, {formatName(user)}
    </h1>
);

ReactDOM.render(
    element,
    document.getElementById('root')
);
function getGreeting(user){
    if(user){
        return <h1>Welcome to wonderful world, {formatName(user)}</h1>
    }
    return <h1>It will be danger and wonderful journey</h1>;
}
